  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Bear River
  Migratory Bird Refuge outlines Refuge accomplishments during the 1987 calendar year.
  The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses the research and investigations.
  Refuge administration is outlined; information about personnel and funding is given.
  Habitat management is also covered; subjects include wetlands and water rights.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, migratory birds, game mammals, fisheries resources, and disease
  prevention and control. The public uses of the Refuge described in this report include
  recreational uses and law enforcement. The equipment and facilities section of the
  report provides information about equipment replacement. Items of interest are provided
  at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
